import{_ as t,o as a,c as r,z as e,a as s}from"./chunks/framework.9482e208.js";const y=JSON.parse('{"title":"§ 16.1-69.36 Where process returnable and trials held in certain cases.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/16.1-69.36.md","filePath":"vacode/16.1-69.36.md"}'),n={name:"vacode/16.1-69.36.md"},o=e("h1",{id:"§-16-1-69-36-where-process-returnable-and-trials-held-in-certain-cases",tabindex:"-1"},[s("§ 16.1-69.36 Where process returnable and trials held in certain cases. "),e("a",{class:"header-anchor",href:"#§-16-1-69-36-where-process-returnable-and-trials-held-in-certain-cases","aria-label":'Permalink to "§ 16.1-69.36 Where process returnable and trials held in certain cases."'},"​")],-1),c=e("p",null,"All process, civil and criminal, returnable before a district court of a county shall, if the defendants or any of them reside in a city or town in which the court is held, be made returnable at the courtroom or place the court is held in such city or town, but if none of the defendants reside therein it shall be made returnable to the county seat, or to one of the other places where the court is held, whichever shall be nearer or more accessible to such defendant or defendants. If the process is made returnable to some other place than the county seat the place to which it is returnable shall be designated therein. For all jurisdictional requirements hereunder the county seat and each and all of the places designated for the holding of the court shall be deemed to be a part of each and every magisterial district in the county.",-1),i=e("p",null,"1972, c. 708; 1973, c. 546.",-1),l=[o,c,i];function h(d,u,p,f,_,b){return a(),r("div",null,l)}const v=t(n,[["render",h]]);export{y as __pageData,v as default};
